#include <string.h>
#include <stdlib.h>

char * sortVowels(char * s){
    int n = strlen(s);
    char *t = (char *)malloc((n + 1) * sizeof(char));
    int vowelCount = 0;

    // Count vowels in the input string.
    for (int i = 0; i < n; i++) {
        if (s[i] == 'a' || s[i] == 'e' || s[i] == 'i' || s[i] == 'o' || s[i] == 'u' ||
            s[i] == 'A' || s[i] == 'E' || s[i] == 'I' || s[i] == 'O' || s[i] == 'U') {
            vowelCount++;
        }
    }

    char *vowels = (char *)malloc((vowelCount + 1) * sizeof(char));
    int j = 0;

    // Extract vowels from the input string.
    for (int i = 0; i < n; i++) {
        if (s[i] == 'a' || s[i] == 'e' || s[i] == 'i' || s[i] == 'o' || s[i] == 'u' ||
            s[i] == 'A' || s[i] == 'E' || s[i] == 'I' || s[i] == 'O' || s[i] == 'U') {
            vowels[j++] = s[i];
        }
    }
    vowels[j] = '\0';

    // Sort the vowels.
    for (int i = 0; i < vowelCount - 1; i++) {
        for (int k = i + 1; k < vowelCount; k++) {
            if (vowels[i] > vowels[k]) {
                char temp = vowels[i];
                vowels[i] = vowels[k];
                vowels[k] = temp;
            }
        }
    }

    j = 0;
    // Place consonants and sorted vowels into the new string.
    for (int i = 0; i < n; i++) {
        if (s[i] == 'a' || s[i] == 'e' || s[i] == 'i' || s[i] == 'o' || s[i] == 'u' ||
            s[i] == 'A' || s[i] == 'E' || s[i] == 'I' || s[i] == 'O' || s[i] == 'U') {
            t[i] = vowels[j++];
        } else {
            t[i] = s[i];
        }
    }
    t[n] = '\0';

    free(vowels);
    return t;
}
